import { Box } from "@chakra-ui/layout";
import { Image, Link, Flex, calc } from "@chakra-ui/react";
import introduction_bg from "../Background/introduction_bg.jpg";
import footer_pic from "../Icons/footer_pic.png";
import Tabs from "../Component/tabs";
import booking from "../Icons/booking_home.png";
export default function Introduction() {
  return (
    <Box
      w="100vw"
      bgColor="#fff9e1"
      bgImg={introduction_bg}
      backgroundRepeat="no-repeat"
      minH="calc(100vw*9/8)"
      backgroundSize="100%"
      position="relative"
    >
      {/* <Box bgImg={introduction_bg} backgroundRepeat="no-repeat" minH="calc(100vw*9/8)" backgroundSize="100%"></Box> */}
      {/* <Image src={introduction_bg} /> */}
      <Tabs page="0" />
      <Box h="calc(100vw*4/5)">
        <Image
          src={booking}
          h="25vw"
          position="sticky"
          top="70vh"
          left="80vw"
        />
      </Box>

      {/* <Image src={footer_pic} zIndex="-1" position="sticky" bottom="0vh" /> */}
    </Box>
  );
}
